import React from 'react'
import img from './img/back6.jpg';

import './home.css';

const Home = () => {
  return (
    <div className='Home'>
        <div className="homeall">
            <img src={img} alt="" className="homeimg" />
        </div>
    </div>
  )
}

export default Home;
